import React from 'react'
import './Kontakt.css'

function Kontakt() {
    return (
        <div className='kontakt'>
            <label>
            <input
              type="text"
            //   onChange={(e) => inputKupon(e.target.value)}
              placeholder='Ime i prezime*'
              />

          </label>
          <label>
            <input
              type="text"
            //   onChange={(e) => inputKupon(e.target.value)}
              placeholder='Email*'
              />

          </label>
          <label>
            <input
              type="text"
            //   onChange={(e) => inputKupon(e.target.value)}
              placeholder='Broj mobitela*'
              />

          </label>
          <label>
            <input
              type="text"
            //   onChange={(e) => inputKupon(e.target.value)}
              placeholder='Napomena(opcionalno)'
              />

          </label>

        </div>
    )
}

export default Kontakt
